A model is a network of clients connected to each other by pairs of output/input. The actor/client interfaces specify the tasks that are going to be executed and the topology of the network defines the order in which the tasks are executed. A pair of output/input defines a unique channel with a sender and a receiver. The sender is given to the output and the receiver to the input. Each actor performs the following task sequentially in a never ending inner loop and asynchronously with respect to the other actors : if any inputs, receive inputs & invoke client Read trait implementation on each input, update client state with the client Update trait implementation, if any outputs, invoke the client Write trait implementation on each output & send outputs. The default behavior of an actor is to pause the inner loop both until all the inputs have been received and until all the outputs have been received by other actors. Model In the model above, the network topology imposes the following sequence of events (from top to bottom): A B C D 1 Update - - - 2 Write::<AB,ABC> - - - 3 - Read::<AB,ABC> Read::<ABC> - 4 Update - Update - 5 Write::<AB,ABC> - Write::<CB,CD> - 6 - Read::<CB> - Read::<CD> 7 - Update Read::<ABC> - 8 - Write::<BD1,BD2> Update - 9 - - Write::<CB,CD> Read::<BD1,BD2> 10 - Read::<AB,ABC,CB> - Update 11 Update Update - Read::<CD> 12 ... Note that events in the same row may occur simultaneously thanks to the asynchronous nature of the actors. Laying out the network consists in building actors outputs and relaying them to other actors inputs. A pair of output and input must meet the following requirements: the client of the output actor must implement the trait Write<I> the client of the input actor must implement the trait Read<O> I and O must be of the same type i.e. I=O the ouput rate NO must be equal to the input rate NI (NO=NI) A model will not compile in any of the above requirements is not met. For client A that gives: A.add_output().build::<AB>().into_input(&mut B);
A.add_output().multiplex(2).build::<ABC>() .into_input(&mut B) .into_input(&mut C); As illustrated above, an output can be multiplexed and sent to multiple inputs. Then for B: B.add_output().build::<BD1>().into_input(&mut D);
B.add_output().build::<BD2>().into_input(&mut D); and C : C.add_output().build::<CB>().into_input(&mut B);
C.add_output().build::<CD>().into_input(&mut D); Per default, an actor inner loop is blocked until all its outputs have been read by the associated inputs as a guarantee that the data has been effectively received. This is not always necessary, particulary for a client that acts as a data sink like D. The links to D can be rewritten: B.add_output().unbounded().build::<BD1>().into_input(&mut D);
B.add_output().unbounded().build::<BD2>().into_input(&mut D);
C.add_output().unbounded().build::<CD>().into_input(&mut D); and the outputs BD1, BD2 and CD won't block their actors inner loop anymore. Once all the connections have been set-up, we can assemble the actors into a model: let mut model = Model::new(vec![Box::new(A),Box::new(B),Box::new(C),Box::new(D)]); check the model for errors, run it and wait for it to finish: model.check()?.run().await?; Note that the run method cannot be invoked on an unchecked model. A flow chart of the model can be obtained with the flowchart method. Each client is identified by either its type or the actor's name if one was given. Combining all the Model methods in a single call gives: Model::new(vec![Box::new(A), Box::new(B), Box::new(C), Box::new(D)]) .flowchart() .check()? .run() .await?; The flowchart is written to the file integrated_model.dot.svg. When an output detects that the data the client has written to its buffer is None, it closes the channel it belongs to and return an error to the actor that forces the actor to shut down. When an actor shuts down its inputs and outputs close the channels they are part of. A closed channel also generates an error that is caught by the actors at both end of the channel and forces these actors to also shut down and so, by a domino effect, all the actors are terminated and the model gracefully comes to an end.

